import React from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const StyledTableCell = withStyles((theme) => ({
  head: {
    backgroundColor:'#2F80ED', // '#2F80ED' theme.palette.common.black
    color: theme.palette.common.white,
  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.background.default,
    },
  },
}))(TableRow);

function createData(time, link_x, link_y, laser_x, laser_y) {
  return { time, link_x, link_y, laser_x, laser_y };
}

const rows = [
  createData('04/06/20 12:43:29.78', 0.159, 0.242, 0.245, 0.407),
  createData('04/06/20 12:43:29.79', 0.237, 0.362, 0.376, 0.432),
  createData('04/06/20 12:43:29.80', 0.262, 0.160, 0.246, 0.608),
  createData('04/06/20 12:43:29.80', 0.305, 0.374, 0.676, 0.436),
  createData('04/06/20 12:43:29.81', 0.356, 0.423, 0.495, 0.393),
];

const useStyles = makeStyles({
  table: {
    minWidth: 700,
  },
});

export default function CoordTable() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell >TIME</StyledTableCell>
            <StyledTableCell align="left">Linx X</StyledTableCell>
            <StyledTableCell align="left">Link Y</StyledTableCell>
            <StyledTableCell align="left">Laser X</StyledTableCell>
            <StyledTableCell align="left">Laser Y</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.time}
              </StyledTableCell>
              <StyledTableCell align="left" fontWeight='bold'>{row.link_x}</StyledTableCell>
              <StyledTableCell align="left">{row.link_y}</StyledTableCell>
              <StyledTableCell align="left">{row.laser_x}</StyledTableCell>
              <StyledTableCell align="left">{row.laser_y}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
